  render(){
    function Example() {
      const [showSearch, setShowSearch] = useState(false);
      const handleCloseSearch = () => setShowSearch(false);
      const handleShowSearch = () => setShowSearch(true);
    }
    return (
      <>
        <Button variant="warning" onClick={Example.handleShowSearch} className="offset-md-8">
        Search
        </Button>

        <Offcanvas placement="top" show={Example.showSearch} onHide={Example.handleCloseSearch}>
          <Offcanvas.Header closeButton>
